import React from 'react';
import './Header.css';

interface HeaderProps {
  activeTab: string;
  onTabChange: (tab: string) => void;
}

const Header: React.FC<HeaderProps> = ({ activeTab, onTabChange }) => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo-section">
          <h1 className="company-name">Moder Car Sale</h1>
          <p className="company-subtitle">Advanced Accounting System</p>
        </div>
        
        <nav className="nav-menu">
          <button className="nav-btn active">Dashboard</button>
          <button className="nav-btn">Vehicle Orders</button>
          <button className="nav-btn">Inventory</button>
          <button className="nav-btn">Expenses</button>
          <button className="nav-btn">Reports</button>
          <button className="nav-btn">Settings</button>
        </nav>
        
        <div className="header-actions">
          <div className="user-info">
            <span className="user-name">Admin User</span>
            <div className="user-avatar">A</div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
